import {SendGetRequest}  from  '../src/api/user';

class Users extends React.Component{

    state = {
        persons: []
      }

      componentDidMount() {
        SendGetRequest()
          .then(res => {
            const persons = res.data;
            this.setState({ persons });
          })
      }


      render() {
        return (
          <ul>
            { this.state.persons.map(person => <li>{person.name}</li>)}
          </ul>
        )
      }
 }
